import React from 'react'
import style from './Tabs.module.scss'

class FirstTabs extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className={style.upperTabs}>
                <div>
                   <p>Social Media Dashboard</p> 
                   <p>Total Followers: 23,004</p> 
                    
        </div>
            <div className='tab'></div>
                {
                    this.props.firstTabList.map((tab) => (
                        <div className='upperTab'>
                            <img src={tab.icon}></img>{tab.user}
                            <p>{tab.number}</p>
                            <p>{tab.type}</p>
                            <img src={tab.upOrDown}></img>
                            <span style={{ color: tab.colorRate }}>{tab.howMany}</span>

                        </div>
                    ))
                }
            </div>
        )
    }

}

export default FirstTabs
